import React,{ Component } from 'react';

class Main extends Component {
    render(){
        return (
         <div>
             <h1>Welcome to The Artificial Intelligence Playground</h1>
             <ul className="header">
                 <li><a href="/"> Home </a></li>
                 <li><a href="/Face-Landmark">Face LandMark</a></li>
                 <li><a href="/Gesture-Recognition">Gesture Recognition</a></li>
                 <li><a href="/Body-Pose-Estimation">Body Pose Estimation</a></li>
                 <li><a href="/Object-History-Detection">Object History Detection</a></li>
                 <li><a href="/Body-Segmentation">Body Segmentation</a></li>
             </ul>
             <div className="content">

             </div>
         </div>
        );
    }
}
